pragma solidity 0.6.12;

import {SafeMath} from "@openzeppelin/contracts-ethereum-package/contracts/math/SafeMath.sol";
import {IERC20} from "@openzeppelin/contracts-ethereum-package/contracts/token/ERC20/IERC20.sol";
import {Initializable} from "@openzeppelin/contracts-ethereum-package/contracts/Initializable.sol";
import {Governed} from "./moc-governance/Governance/Governed.sol";
import {IGovernor} from "./moc-governance/Governance/IGovernor.sol";

/// @title This contract provides an interface for the flow buffers
interface IFlowBuffer {
    function liquidate() external;

    function flush(uint256 i) external;

    function getBalance() external view returns (uint256);

    function getThreshold() external view returns (uint256);

    function getSplit() external view returns (uint256);

    function getLiquidated() external view returns (uint256);

    function getToken() external view returns (address);

    function getNumOutputs() external view returns (uint256);

    function getAll()
        external
        view
        returns (
            uint256 balance,
            uint256 threshold,
            uint256 splitTotal,
            uint256 liquidated,
            address token,
            uint256 outputs
        );

    function isFlushable(uint256 i) external view returns (bool);

    function isLiquidable() external view returns (bool);

    function getOutput(uint256 idx)
        external
        view
        returns (
            address output,
            uint256 split,
            uint256 balance,
            uint256 threshold
        );
}

interface IFlowCoiner {
    /// @notice Returns true if conditions for minting are satisfied.
    function readyToMint() external view returns (bool);

    /// @notice Triggers a minting step, if the enough number of blocks had elapsed.
    //          If there is zero tokens remaining, it will do nothing.
    function mintStep() external;

    /// @notice Returns the % of remaining tokens that the contract will output on each "mintStep" call in stage I
    function getFirstStagePercent() external view returns (uint256);

    /// @notice The constant amount of  tokens that the contract will output on each "mintStep" call
    /// in stage II until target is reached.
    function getSecondStageConstant() external view returns (uint256);

    /// @notice Output account address.
    function getDestination() external view returns (address);

    /// @notice How many tokens will be minted for this address
    function getTotalMintTarget() external view returns (uint256);

    /// @notice Returns the remaining amount to mint.
    function getRemainingToMint() external view returns (uint256);

    /// @notice Returns the cut-off value where the constant emission stage II starts
    function getStage2BeginThreshold() external view returns (uint256);

    /// @notice Returns the minimum number of blocks between minting steps
    function getMintBlockInterval() external view returns (uint256);

    /// @notice Returns the block number from where the mint step can be issued
    function getNextMintFromBlock() external view returns (uint256);
}

interface IFlowDripper {
    function getOutput() external view returns (address payable);

    function getBlockTime() external view returns (uint256);

    function getDrop() external view returns (uint256);

    function getBalance() external view returns (uint256);

    function getLastBlock() external view returns (uint256);

    function drop() external;

    function isDripable() external view returns (bool);
}

interface IFlowReverseAuction {
    /** @dev Return the current in-bound token balance */
    function getInboundTokenBalance() external view returns (uint256);

    /** @dev Return the current out-bound token balance */
    function getOutboundTokenBalance() external view returns (uint256);

    /** @dev Returns `true` if there is enough inbound tokens to trigger exchange orders **/
    function readyToTriggerOrders() external view returns (bool);

    /** @dev Returns `true` if there is enough outbound tokens to trigger exit **/
    function readyToTriggerExit() external view returns (bool);

    /** @dev Triggers an exchange order **/
    function triggerOrders() external;

    /** @dev Triggers an exit order transferring the exit threshold amount to the output account **/
    function triggerExit() external;

    function getInboundToken() external view returns (address);

    function getOutboundToken() external view returns (address);

    function getMultiplyFactor() external view returns (uint256);

    function getOrderLifespan() external view returns (uint64);

    function getOrderThreshold() external view returns (uint256);

    function getExitThreshold() external view returns (uint256);

    function getOutputAccount() external view returns (address);
}
